   *
   * * [NodeValidator]
   * * [NodeTreeSanitizer]
   */
  DocumentFragment createFragment(String? html,
      {NodeValidator? validator, NodeTreeSanitizer? treeSanitizer}) {
    if (treeSanitizer == null) {
      if (validator == null) {
